<!DOCTYPE html>
<html>
<head>
    <title>Login</title>
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <meta http-equiv="Content-Type" content="text/html; charset=utf-8" />
    <meta name="robots" content="noindex, nofollow">
    <meta name="description" content="Login">
    <meta name="keywords" content="Console, Bot, Discord, Bot Console, Websocket, Socket.io, Client, Server, MiraiBot">
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/highlight.js/10.7.2/styles/default.min.css">
<style>
    body {
        margin: 0;
        padding: 0;
        height: 100vh;
        display: flex;
        flex-direction: column;
        align-items: center;
        justify-content: center;
        transition: background-color 0.3s ease, color 0.3s ease;
  background-size: cover;
  background-repeat: no-repeat;
  background-position: center;
  color: white;
    }

    .login-container {
        width: 300px;
        margin: 100px auto;
        background-color: #fff;
        padding: 20px;
        border-radius: 5px;
        box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);
    }

    h2 {
        text-align: center;
        color: #333;
    }

    input[type="text"],
    input[type="password"],
    textarea {
        width: 100%;
        padding: 10px;
        margin: 10px 0;
        border: 1px solid #ccc;
        border-radius: 4px;
        box-sizing: border-box;
    }

    input[type="submit"],
    button {
        width: 100%;
        background-color: #4CAF50;
        color: white;
        padding: 14px 20px;
        margin: 8px 0;
        border: none;
        border-radius: 4px;
        cursor: pointer;
    }

    input[type="submit"]:hover,
    button:hover {
        background-color: #45a049;
    }

    .container-token,
    .container-appstate {
        display: none;
        width: 300px;
        margin: 20px auto;
        background-color: #fff;
        padding: 20px;
        border-radius: 5px;
        box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);
        transition: display 0.3s ease;
    }

    .container-token h2,
    .container-appstate h2 {
        text-align: center;
        color: #333;
    }

    #submit-bot {
        display: none;
        width: 100%;
        background-color: #4CAF50;
        color: white;
        padding: 14px 20px;
        margin: 8px 0;
        border: none;
        border-radius: 4px;
        cursor: pointer;
    }

    #submit-bot:hover {
        background-color: #45a049;
    }

    .alert-overlay {
        display: none;
        position: fixed;
        top: 0;
        left: 0;
        width: 100%;
        height: 100%;
        background-color: rgba(0, 0, 0, 0.5);
        justify-content: center;
        align-items: center;
    }

    .alert-box {
        background-color: #333;
        color: #fff;
        padding: 20px;
        border-radius: 5px;
    } 
</style>

</head>
<body>
    <div class="login-container" id="login-container">
        <h2>Login</h2>
        <form id="login-form">
            <input type="text" id="email" name="email" placeholder="Email/Number/UID">
            <input type="password" id="password" name="password" placeholder="Password">
            <input type="submit" value="Login">
        </form>
    </div>

    <div class="container-token" id="token-container">
        <h2>Edit Token</h2>
        <div id="token-form">
            <textarea type="text" id="token" name="token" placeholder="Token"></textarea>
        </div>
    </div>

    <div class="container-appstate" id="appstate-container">
        <h2>Edit AppState</h2>
        <div id="appstate-form">
            <textarea id="appstate" name="appstate" rows="6" placeholder="AppState"></textarea>
        </div>
    </div>

    <button type="button" id="submit-bot">Become a bot now</button>


    <div class="alert-overlay" id="alert-overlay">
        <div class="alert-box" id="alert-box">
            <p id="alert-message"></p>
        </div>
    </div>

    <script src="https://cdnjs.cloudflare.com/ajax/libs/axios/0.24.0/axios.min.js"></script>
